import React from "react";

class App extends React.Component {
  render() {
    return (
      <div>
        <div className="ui container">
          <form className="ui input focus">
            <label>Income</label>
            <input type="text" placeholder="Enter the total income" />
            <button className="ui button" type="submit">
              Enter
            </button>
          </form>
        </div>
        <div>
          <form className="ui input focus">
            <label>Expenses</label>
            <input type="text" placeholder="Enter the expenses" />
            <button className="ui button" type="submit">
              Enter
            </button>
          </form>
        </div>
      </div>
    );
  }
}

export default App;
